import { ProductsMarketData } from "./ProductsMarketData";

const Products = () => {
    const products = {'Ean001': {'name': 'product1', 'data': [{'lowest_active_price': 7000, 'SKU': 'SKU-001', 'market': 'mercado2'}, {'lowest_active_price': 8000, 'SKU': 'SKU001', 'market': 'mercado1'}], 'markets': 2, 'price_range': '(10000 - 7000)'}, 'Ean002': {'name': 'producto2', 'data': [{'lowest_active_price': 18000, 'SKU': 'SKU002', 'market': 'mercado2'}], 'markets': 1, 'price_range': '(20000 - 18000)'}, 'Ean003': {'name': 'producto3', 'data': [{'lowest_active_price': 12000, 'SKU': 'SKU003', 'market': 'mercado1'}], 'markets': 1, 'price_range': '(16000 - 12000)'}}

    return (
        <div className="row">
            {Object.entries(products).map(([ean, value]) => {
                return (
                    <div className="col">
                        <div className="card" style={{width: "18rem", height: "18rem"}}>
                            <div className="card-body overflow-auto">
                                <h5 className="card-title text-capitalize">{value.name}</h5>
                                <h6 className="card-subtitle mb-2 text-body-secondary">{ean}</h6>
                                <p className="card-text">Price Range: {value.price_range}</p>
                                <p className="card-text">Available in {value.markets} markets</p>
                                <ul class="list-group list-group-flush">
                                    <ProductsMarketData data={value.data}/>
                                </ul>
                            </div>
                        </div>
                    </div>
                );
            })}
        </div>
    );
};

export default Products;
